'use strict';

angular.module('app.resources', ['ngResource']);
angular.module('app.templates', []);
angular.module('app.services', []);

angular.module('app', ['ngRoute', 'app.resources', 'app.templates', 'app.services'])
	.config(['$httpProvider', function ($httpProvider) {
			$httpProvider.interceptors.push('progressInterceptor', 'errorInterceptor');
		}])
	.run();

angular.module('app').config(['$routeProvider', '$locationProvider',
	function ($routeProvider, $locationProvider) {
		$routeProvider
			.when('/', { templateUrl: 'sites/create.html', controller: 'CreateCtrl' })
			.when('/new', { templateUrl: 'sites/create.html', controller: 'CreateCtrl' })
			.when('/list', {
				templateUrl: 'sites/list.html',
				controller: 'ListCtrl',
				resolve: {
					sites: function (sites) {
						return sites.list().$promise;
					}
				}
			})
			.when('/view/:directory', {
				templateUrl: 'sites/view.html',
				controller: 'ViewCtrl',
				resolve: {
					site: function ($route, sites) {
						return sites.get({ directory: $route.current.params.directory }).$promise;
					}
				}
			})
			.otherwise({ redirectTo: '/' });

		$locationProvider.html5Mode(true);
	}
]);

'use strict';

angular.module('app').controller('CreateCtrl', function ($scope, $http, $location, sites, userAgents) {
	$scope.userAgents = userAgents.list();
	$scope.showAdvancedOptions = false;

	$scope.toggleAdvancedOptions = function() {
		$scope.showAdvancedOptions = !$scope.showAdvancedOptions;
	};

	$scope.add = function () {
		sites.save($scope.data).$promise.then(function siteScraped (site) {
			$location.path('/view/' + site.directory);
		});
	};

	$scope.reset = function () {
		$scope.setDefaults();
		$scope.scraperForm.$setPristine();
	};

	$scope.setDefaults = function () {
		var defaults = {
			url: '' ,
			request: {
				headers: {
					'User-Agent': $scope.userAgents[0].userAgent
				}
			}
		};
		$scope.data = angular.copy(defaults);
	};

	$scope.setDefaults();
});

'use strict';

angular.module('app').controller('ListCtrl', function ($scope, sites) {
	$scope.sites = sites;
});

'use strict';

angular.module('app').controller('ViewCtrl', function ($scope, site) {
	$scope.site = site;
});

angular.module('app').factory('errorInterceptor', ['$rootScope', '$q',
	function ($rootScope, $q) {
		return {
			request: function request (config) {
				$rootScope.hasErrors = false;
				return config;
			},
			responseError: function responseError (rejection) {
				$rootScope.hasErrors = true;
				return $q.reject(rejection);
			}
		};
}]);

angular.module('app').factory('progressInterceptor', ['$q', function ($q) {
	var depth = 0;

	var loader = $('#ajax-loader');
	var minLoaderIndex = 0;
	var maxLoaderIndex = 6;
	var currentLoaderIndex;

	function getLoaderClass(i) {
		return 'ajax-loader-' + i;
	}

	function getLoaderIndex() {
		return Math.floor(Math.random() * (maxLoaderIndex - minLoaderIndex + 1));
	}

	function start () {
		currentLoaderIndex = getLoaderIndex();
		loader.removeClass('hidden').addClass(getLoaderClass(currentLoaderIndex));
	}

	function stop () {
		loader.addClass('hidden').removeClass(getLoaderClass(currentLoaderIndex));
	}

	return {
		request: function request (config) {
			if (++depth == 1) {
				start();
			}

			return config;
		},

		response: function response (response) {
			if (--depth == 0) {
				stop();
			}
			return response;
		},

		responseError: function responseError (rejection) {
			if (--depth == 0) {
				stop();
			}

			return $q.reject(rejection);
		}
	};
}]);

angular.module('app.resources').factory('sites', function ($resource) {
	return $resource('/sites/:directory', { directory: '@directory' }, {
		list: { method: 'GET', isArray: true },
		get: { method: 'GET' },
		create: { method: 'POST' }
	});
});

